import React from "react";
import "./App.css";
import Header from "./Header";
import Hero from "./Hero";

import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
	return (
		<Router>
			<div>
				<Switch>
					<Route path="/">
						<Header />
						<Hero />
					</Route>
					<Route path="/about">
						<h1>This is about Page</h1>
					</Route>
					<Route path="/login">
						<Header />
					</Route>
				</Switch>
			</div>
		</Router>
	);
}

export default App;
